import "./Page.css";
import { useParams } from "react-router-dom";

const Page = () => {
  const { name } = useParams();

  return (
    <div className="page">
      <h1>
        Everything you need to know about{" "}
        {name.charAt(0).toUpperCase() + name.slice(1)}.
      </h1>
    </div>
  );
};

export default Page;
